import React, { useState, useEffect } from 'react';
import { useNavigate } from "react-router-dom";
import { NumericFormat } from "react-number-format";
import { Link } from 'react-router-dom';
import {
  Modal,
  ModalHeader,
  ModalBody,
  ModalFooter,
} from 'reactstrap';

const AllLoan = () => {
  const [data, setData] = useState('');
  const navigate = useNavigate();

  const email = localStorage.getItem("email");

  useEffect(async () => {
    const newLoan = {
        createdBy: email
    };
        const response = await fetch('http://localhost:8080/api/loans', {
            method: 'GET',
            headers: {
                'Content-Type': 'application/json',
            },
            body: JSON.stringify({newLoan}),
        });

        if (!response.ok) {
            throw new Error(`HTTP error! Status: ${response.status}`);
        }

        const data = await response.json();
        console.log('assdasdasdsdsafafafas', data)
        setData(data)
  });

const goback = () => {
  navigate("/dashboard");
};

  return (
    <div>
      <h1 className="mb-5">Apply for loan</h1>
      <form onSubmit={_Submitloan}>
      <div className="form-group form-mod has-feedback form-field form-floating mb-2">
        <input
          autoComplete="off"
          className={
            "form-control default-input " +
            (Errors["IsEmpty_name"] === true ? " has-err" : "")
          }
          type="text"
          id="name"
          maxLength="128"
          name="name"
          placeholder="Enter Name"
          defaultValue={name}
          data-fv-field="name"
          tabIndex="1"
          onChange={(e) => setName(e.target.value)}
        />
        {Errors["IsEmpty_name"] === true ? (
          <div className="has-err-msg">{Errors["nameEmptyMsg"]}</div>
        ) : (
          ""
        )}
        <label className="default-label" htmlFor="name">
          Name
        </label>
      </div>
      <div className="form-group form-mod form-floating mb-2 form-field" style={{ marginTop: "24px" }}>
        <NumericFormat inputMode="numeric" autoComplete="off" tabIndex="3" className={"form-control default-input" + (Errors["IsEmpty_loan_amount"] === true ? " has-err" : "")} type="text" id="loan_amount" placeholder="Enter the Loan Amount" require=""  name="loan_amount" defaultValue={loanAmount} onChange={(e) => setLoanAmount(e.target.value)} />
        {Errors['IsEmpty_loan_amount'] === true ? <div className="has-err-msg">{Errors['loan_amountEmptyMsg']}</div> : ''}
      </div>
      <div className="form-mod has-feedback form-floating mb-2 mt-2 form-field">
        <select className={"form-control form-select " + (Errors["IsEmpty_loanterm"] === true ? " has-err" : "")} aria-label="Floating label" name="loanterm" id="loanterm" tabIndex="4" value={loanTerm} onChange={(e) => setLoanTerm(e.target.value)}>
          <option value="">Select One</option>
          <option value="1">1 Month</option>
          <option value="2">2 Month</option>
          <option value="3">3 Month</option>
          <option value="4">4 Month</option>
          <option value="5">5 Month</option>
          <option value="6">6 Month</option>
        </select>
        {Errors["IsEmpty_loanterm"] === true ? <div className="has-err-msg">{Errors["loantermEmptyMsg"]}</div> : ""}
        <label htmlFor="loanterm">Loan Term</label>
      </div>
      <div className="buttons button_space  mt-3">
        <button type="button" className="back_button px-3" onClick={goback}>
          Go Back
        </button>
        <button type="button" className="next_button" onClick={_Submitloan}>
          Submit
        </button>
      </div>
    </form>

      <Modal isOpen={modal} toggle={toggle}>
        <ModalHeader toggle={toggle}>Application Submitted</ModalHeader>
        <ModalBody>
          Your loan application was successfully submitted and is under review
          for approval.
        </ModalBody>
        <ModalFooter>
          <Link to={`/all-loans`} className="btn btn-success btn-lg">
            Done
          </Link>
        </ModalFooter>
      </Modal>
    </div>
  );
};

export default AllLoan
